import React from 'react';
import {sum, diff, mult, div} from "./Calculator";


function App(){
    return(
        <>
            <ul>
                <li>{`The sum is ${sum(1,2)}`} </li>
                <li>{`The diff is ${diff(3,1)}`}</li>
                <li>{`The mult is ${mult(4,4)}`}</li>
                <li>{`The divide is ${(div(22,7)).toFixed(2)}`}</li>
            </ul>   
        </>
    );
}

export default App;
